import { useEffect, useState } from "react";
import { Container } from "react-bootstrap";
import "../../styles/Login.css";
import { Navigate, useNavigate } from "react-router-dom";


function Recover(){
    const [email, setEmail] = useState('')
    const [pass, setPass] = useState('')
    const navigate = useNavigate()
    useEffect(() => {
       
        document.body.classList.add('login-page');
        
        return () => {
          document.body.classList.remove('login-page');
        };
      }, []);
    return (

        
        <Container className="d-flex justify-content-center align-items-center min-vh-100">
            
            <form className="login-form">
                <input type="text" placeholder="Email" className="form-control mb-3"></input>
                <input type="password" placeholder="Password" className="form-control mb-3"/>
                <button type="submit" className="btn btn-primary w-100">Recover password</button>
                <button type="submit" className="btn btn-primary w-100 mt-2" onClick={() => navigate("/login")}>To login</button>
            </form>
        </Container>
    )
}


export default Recover;
